const getProductByBarcode = (barcode) => {

        fetch("db/products.json")
        .then(response => response.json())
        .then(data => {
            const product = data.find((product)=> product.barcode === barcode);
            console.log(product);
        })
        .catch(err => console.log(err))
    return ;
}

export default getProductByBarcode;
